description:
This classic 1959 version of \&quot;House on Haunted Hill\&quot; is one of the most entertaining examples of the low-budget, black-and-white horror films that used to be such a mainstay for movie fans. It has few frills, but it does have some thrills, and in particular it has a cleverly written story that is told at a brisk pace, with a good deal of interesting and pleasingly macabre detail.

Frederick Loren (Vincent Price) has invited five strangers to a party of a lifetime. He is offering each of them $10,000 if they can stay the night in a house. But the house is no ordinary house. This house has reputation for murder. Frederick offers them each a gun for protection. They will all arrived in a hearse and will either leave in it $10,000 richer or leave in it dead!
